import React from 'react';
import Pirate from './Pirate.js';


const PirateList = (props) => {
if (props.pirate.length === 0) {
	return(<p>Loading...</p>)
}
const pirates = props.pirates.map((pirate, index) => {
	<li>{pirate.name}</li>
})
	return (
		<div>
			<ul>
				{pirates}
			</ul>
		</div>

	)
}
 export default PirateList;
